 const top_type:any = {"male":["Turban","ShortHairDreads01","ShortHairDreads02"],"female":["Hijab","LongHairBigHair","LongHairBob","LongHairCurly","LongHairFrida","LongHairNotTooLong","LongHairCurvy","LongHairStraight"],"n/a":["NoHair","Hat"]};
