  const skin_color:any = {"fair":"Light","brown":"Brown","gold":"Yellow","white":"Light","light":"Light"}

    return(<>
    <Avatar avatarStyle='Circle' topType= {top_type[porps.gender][Math.floor(Math.random() * top_type[porps.gender].length)]||['NoHair']} hairColor={hair_color[porps.hair_color]||"Brown"} skinColor={skin_color[porps.skin_color]||"Brown"}/>

    </>)
}

